import { DataSource } from 'typeorm';
import { CompanyEntity } from '../../modules/company/entities/company.entity';

export const companySeed = async (dataSource: DataSource): Promise<void> => {
    const companyRepository = dataSource.getRepository(CompanyEntity);
    
    const existingCompanies = await companyRepository.find();
    if (existingCompanies.length > 0) {
        return;
    }

    const companies = [
        {
            Id: 1,
            VcName: "Golden Nails Spa",
            VcDescription: "Centro especializado en servicios de manicura, pedicura y cuidado de uñas",
            VcPhone: "3121234567",
            VcPrincipalAddress: "Cll 57bsur #68b-16, Bogotá, Colombia",
            VcPrincipalEmail: "info@goldennailsspa.com",
            VcLegalRepresentative: "Ana Rodríguez Castro",
            UserId: 1,
            TxLogo: "data:image/avif;base64,",
            TxImages: "data:image/png;base64,",
            created_at: new Date().toISOString(),
            updated_at: new Date().toISOString()
        }
    ];
    await companyRepository.insert(companies);
};